const getBlogPosts = async () => {
  try {
    const response = await fetch("https://3.75.158.163:8080/getBlogPosts", {
      method: "GET",
    });
    if (!response.ok) {
      throw new Error("Could't fetch the posts");
    }
    return await response.json();
  } catch (error) {
    console.error(error);
    return null;
  }
};
export default getBlogPosts;
